import React from 'react';

interface Trip {
    id: number;
    firstName: string;
    lastName: string;
    route: string;
}

interface TripListProps {
    drivers: Trip[];
}

export const TripList: React.FC<TripListProps> = ({ drivers }) => {
    return (
        <ul>
            {drivers.map((driver) => (
                <li key={driver.id}>
                    <strong>{driver.firstName} {driver.lastName}</strong> - {driver.route}
                </li>
            ))}
        </ul>
    );
};
